import React from 'react';

function Task({ task, provided }) {
  return (
    <div
      className="task"
      {...provided.draggableProps}
      {...provided.dragHandleProps}
      ref={provided.innerRef}
    >
      {task.content}
    </div>
  );
}

export default Task;
